import React from 'react';
import { Paper, TextField } from '@material-ui/core'

class SearchBar extends React.Component {
    state = {
        searchTerm: '',
    }

    render() {
        return (
            <Paper elevation={6} style>
                <form>
                    <TextField fullwidth label="search..."></TextField>
                </form>
            </Paper>
        )
    }
}

export default SearchBar;
